import './App.css';

function App() {
  return (
    <div className="App">
      <nav className="navbar">
        <ul className="navlist">
          <li><a href="#home">Home</a></li>
          <li><a href="#doc">Doc</a></li>
          <li><a href="#faq">FAQ</a></li>
          <li><a href="#contact">Contact</a></li>
        </ul>


      </nav>
    </div>
  );
}

export default App;
